// Fungsi untuk Fly ke Lokasi dan Highlight
function flyToLocation(lng, lat, geoJsonFeature) {
  mainMap.flyTo([lat, lng], 15);
  if (geoJsonFeature) {
    L.geoJSON(geoJsonFeature, {
      style: {
        color: "blue",
        weight: 2,
        fillOpacity: 0.5,
      },
    })
      .addTo(mainMap)
      .bringToFront();
  }
}

